import React from "react";

import Item from "./item";

const SearchView = ( props ) =>{

    const { items } = props

    return(
        <div>
            {items.map( ( el, index )=>(
                <Item key={el.id} data = {el}/>
            ))}
        </div>
    )
}

export default SearchView
